import Carousel from "react-multi-carousel";
export default class Products extends React.Component{

    render(){

        const responsive = {
            superLargeDesktop: {
              // the naming can be any, depends on you.
              breakpoint: { max: 4000, min: 3000 },
              items: 5,
            },
            desktop: {
              breakpoint: { max: 3000, min: 1024 },
              items: 3,
            },
            tablet: {
              breakpoint: { max: 1024, min: 464 },
              items: 2,
            },
            mobile: {
              breakpoint: { max: 464, min: 0 },
              items: 1,
            },
          };

        return(
            <React.Fragment>
                <div className="container">
                    <div className="row">
                        <div className="products-categories col-md-12">
                            <Carousel>
                                <div>
                                    Item 1
                                </div>
                                <div>
                                    Item 2
                                </div>
                                <div>
                                    Item 3
                                </div>
                                <div>
                                    Item 4
                                </div>
                                <div>
                                    Item 5
                                </div>
                                <div>
                                    Item 6
                                </div>
                            </Carousel>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}
